import React from "react";
import "./Train_vdo.css";


function Train_vdo(){
    return(
       <>
       <video controls loop className="VDO" muted autoPlay>
        src=require{'./Train_video.mp4'}

       </video>
       </>
    );
}
export default Train_vdo;
